#
# Structure for table "warehouse_user"
#

DROP TABLE IF EXISTS `warehouse_user`;
CREATE TABLE `warehouse_user` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT '' COMMENT '用户名称',
  `pwd` varchar(255) DEFAULT '' COMMENT '用户密码',
  `add_time` varchar(255) DEFAULT '' COMMENT '添加时间',
  PRIMARY KEY (`Id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='用户表';

